import React from "react"
import { awrapper } from "../../dummydata"
import "./awrapper.css" // Ensure the CSS file is imported

const Awrapper = () => {
  return (
    <>
      <section className="awrapper">
        <div className="container">
          {awrapper.map((val, index) => {
            return (
              <div className="box" key={index}>
                <div className="img">
                  <img src={val.cover} alt={val.title} />
                </div>
                <div className="text">
                  <h1>{val.data}</h1>
                  <h3>{val.title}</h3>
                </div>
              </div>
            )
          })}
        </div>

        <div className="about-section">
          <div className="about-card">
            <h2>About Jai Kisan Agro</h2>
            <p>
              Jai Kisan Agro is a forward-thinking agricultural company dedicated to transforming waste into health. Through innovative agricultural waste recycling techniques, we reduce environmental impact while contributing to sustainable farming growth.
            </p>
          </div>

          <div className="about-card">
            <h2>Our Mission</h2>
            <p>
              To reduce the harmful environmental impact of agricultural waste and promote a circular economy. By recycling waste, we minimize pollution and create valuable resources for enhanced soil health and crop yields.
            </p>
          </div>

          <div className="about-card">
            <h2>Our Vision</h2>
            <p>
              We envision a world where farmers have access to sustainable, eco-friendly solutions. By leveraging cutting-edge technology, Jai Kisan Agro contributes to a healthier planet and a prosperous future for farmers.
            </p>
          </div>

          <div className="about-card">
            <h2>What We Do</h2>
            <ul>
              <li>Agri Waste Recycling: Turning waste into compost, fertilizers, and biogas.</li>
              <li>Soil Health Improvement: Promoting sustainable farming practices.</li>
              <li>Eco-Friendly Solutions: Offering biodegradable packaging and renewable energy options.</li>
              <li>Farmer Empowerment: Providing tools and support for greener farming.</li>
            </ul>
          </div>

          <div className="about-card">
            <h2>Our Values</h2>
            <ul>
              <li>Sustainability: Transforming waste into resources to reduce pollution.</li>
              <li>Innovation: Exploring new technologies for better products and services.</li>
              <li>Empathy: Creating farmer-centric solutions for efficiency and profitability.</li>
            </ul>
          </div>
        </div>
      </section>
    </>
  )
}

export default Awrapper
